.accordion-toggle {
    position: relative;
    display: block;
    line-height: 25px; 
    &.icon-none {
    	&:after {display: none;}	
    }
    &:after {
        font-family: 'themify';
        position: absolute;
        content: "\e64b";
        right: -10px;
        top:1px;
        color: #999;
        font-weight: lighter;
        transform: rotate(-180deg);
        transition: all 0.2s ease-in;
    }
    &.collapsed::after {
        color: #999;
        transform: rotate(0deg);
        transition: all 0.2s ease-in;
    }
}

