.toggle {
    display: inline-block;
    vertical-align: middle;
    position: relative;
    box-sizing: border-box;
    align-self: center;
    -webkit-user-select: none;
    -moz-user-select: none;
    user-select: none;
    cursor: pointer;
    input[type=checkbox] {
        display: none;
    }
    .toggle-icon {
        z-index: 0;
        margin: 0;
        padding: 0;
        -webkit-appearance: none;
        -moz-appearance: none;
        appearance: none;
        border: none;
        position: relative;
        transition: .3s;
        box-sizing: border-box;
        display: block;
        cursor: pointer;
        width: calc(#{$setting-toggle-width * 2});
        height: calc(#{$setting-toggle-width} + 2px);
        border-radius: $setting-toggle-width;   
        background: #eee;;
        &:before {
            content: '';
            position: absolute;
            left: 2px;
            top: 2px;
            height: calc(#{$setting-toggle-width} - 4px);
            width: calc(#{$setting-toggle-width} - 4px);
            border-radius: 18px;;
            box-sizing: border-box;
            background: #fff;
            box-shadow: 0 2px 4px rgba(0, 0, 0, .3);
            z-index: 1;
            transition-duration: .3s;
            transform: scale(1);
        }
        &:after {
            height: calc(#{$setting-toggle-width} - 4px);
            width: calc(#{$setting-toggle-width} - 4px);
            top: 2px;
            left: 2px;
            box-shadow: 0 2px 4px rgba(0, 0, 0, .3);
            border-radius: calc(#{$setting-toggle-width} - 4px);
            background: #fff;
            position: absolute;
            z-index: 2;
            transform: translateX(0px);
            transition-duration: .3s;
            content: '';
        }
    }
}
.toggle input[type=checkbox]:checked+.toggle-icon {
    background: #ff3b30;;
}

.toggle input[type=checkbox]:checked+.toggle-icon:after {
    transform: translateX($setting-toggle-width);
}
.toggle input[type=checkbox]:checked+.toggle-icon:before {
    opacity: 0; 
}

.switchcolor-wrap {
