    &.last-member {
      a {
        width: 30px; 
        height: 30px; 
        display: inline-block;
        border-radius: 30px; 
        line-height: 30px; 
      }
    }
  }
}

 

// CHAT WIDGET
.chatlist {
    .item {
        width: 55px; 
        img {width: 100%;border:2px var(--theme-color) solid; border-radius: 50px; padding: 2px;  }
    }
    .item.dashed { img {border:2px var(--theme-color) dashed; } }
    .item.online:after {
        width: 10px;
        height: 10px;
        background-color: $success; 
        position: absolute;
        bottom:3px;
        right:3px;
        display: inline-block;
        z-index: 2; 
        content: '';
        border-radius: 5px; 
    }
    &.style2 {
        .item {
            width: 55px;
            border:2px solid transparent;
            &.no-ouline {
                &:before {content: none;}
                border:2px #999 solid;
                border-radius: 30px; 
                text-align: center;
                line-height: 52px; 
                span {line-height: 20px; width: 110%; left: -6%; margin-top: 2px; }
            }
            &:before {
                content: '';
                position: absolute;
                top: 0; right: 0; bottom: 0; left: 0;
                z-index: -1;
                margin: 0px; /* !importanté */
                border-radius: inherit; /* !importanté */
                background: linear-gradient(to right, red, orange);
                border-radius: 30px !important;
            } 
            img {border:2px #fff solid; margin: 0px; border-radius: 32px !important;}
            &.online:after {
                bottom:2px;
                right:2px;
            }
            span {position: absolute; width: 100%; margin-top: 3px;   text-align: center;}
        }
    }
